import React, {Component} from 'react';
import InfoSection from './InfoSection';

interface Props {
    num: string,
    title: string,
    subtitle: string,
    overviewText: string,
    overviewOptions: {},
    recommendationsText: string,
    recommendationsOptions: {},
    videoUrl: string,
};

class Step extends Component<Props> {

    render() {
        const {
            num, 
            title, 
            subtitle, 
            overviewText, 
            overviewOptions, 
            recommendationsText, 
            recommendationsOptions,
            videoUrl } = this.props;

        return (
            <div>
                <h4>Step {num}</h4>
                <h2>{title}</h2>
                <h5> {subtitle}</h5>
                <InfoSection type='Overview' text={overviewText} options={overviewOptions}/>
                <InfoSection type='Recommendations' text={recommendationsText} options={recommendationsOptions}/>
            </div>
        );
    };
};

export default Step;
